var allColors = [];
var colorGlossary = {};
for (var name in colorGlossaryReverse) {
    var hex = colorGlossaryReverse[name];
    if (!colorGlossary.hasOwnProperty(hex)) {
        colorGlossary[hex] = [];
        allColors.push(hexToRgb(hex));
    }
    colorGlossary[hex].push(name);
}

function randomHexColor() {
    return rgbObjToHex(allColors[Math.floor(Math.random()*allColors.length)]);
}

function euclideanDistance(c0, c1) {
    return Math.sqrt(
        Math.pow(c0.r - c1.r, 2) +
        Math.pow(c0.g - c1.g, 2) +
        Math.pow(c0.b - c1.b, 2)
    );
}

var colorProximityTree = new kdTree(
    allColors,
    euclideanDistance,
    ["r", "g", "b"]
);